(30, '2', '2', 2, 'Lamb Samosa (S)', 'Scrumptious light and crispy pastry filled with your choice of savoury filling. The hard part is deciding between the delicious fillings.', NULL, '2.95', 0, 0, 0, 0, '2020-07-06 01:53:41', '2020-07-08 03:29:25'),
(31, '2', '2', 3, 'Chicken Samosa (S)', 'Scrumptious light and crispy pastry filled with your choice of savoury filling. The hard part is deciding between the delicious fillings.', NULL, '2.95', 0, 0, 0, 0, '2020-07-06 01:54:53', '2020-07-08 03:29:25'),
(32, '2', '2', 4, 'Veg Samosa (S)', '(V). Scrumptious light and crispy pastry filled with your choice of savoury filling. The hard part is deciding between the delicious fillings.', NULL, '2.95', 0, 0, 0, 0, '2020-07-06 01:55:19', '2020-07-08 03:29:25'),
(33, '2', '2', 5, 'Chicken Tikka (S)', 'Succulent pieces of tender chicken marinated in yoghurt and a blend of special mild spices, barbecued over charcoal. Finger licking stuff', NULL, '3.45', 0, 0, 0, 0, '2020-07-06 01:55:53', '2020-07-08 03:29:25'),
(34, '2', '2', 6, 'Lamb Tikka (S)', 'Succulent pieces of tender lamb marinated in yoghurt and a blend of special mild spices, barbecued over charcoal. Finger licking stuff', NULL, '3.25', 0, 0, 0, 0, '2020-07-06 01:56:23', '2020-07-08 03:29:25'),
(35, '2', '2', 7, 'Tandoori Chicken (S)', 'Tender chicken on the bone, marinated in yoghurt and delicate aromatic spices. A classic favourite finished to perfection with Masala Boyz secret twist', NULL, '2.95', 0, 0, 0, 0, '2020-07-06 01:56:50', '2020-07-08 03:29:25'),
(36, '2', '2', 8, 'Lamb Sheek Kebab (S)', 'Minced Lamb blended with spices and onions, skewered and barbecued over charcoal. Definitely not your average sausage', NULL, '3.25', 0, 0, 0, 0, '2020-07-06 01:57:19', '2020-07-08 03:29:25'),
(37, '2', '2', 9, 'Mix Kebab (S)', 'Chicken Tikka, Lamb Tikka and Sheek Kebab.', NULL, '3.65', 0, 0, 0, 0, '2020-07-06 01:57:52', '2020-07-08 03:29:25'),
(38, '2', '2', 10, 'Shami Kebab (S)', 'Shami Kebab Starter', NULL, '3.45', 0, 0, 0, 0, '2020-07-06 01:58:22', '2020-07-08 03:29:25'),
(39, '2', '2', 11, 'Chicken Pakora (S)', 'Chicken pieces in a lightly spiced gram flour, deep fried. Too good to share.', NULL, '3.55', 0, 0, 0, 0, '2020-07-06 01:58:45', '2020-07-08 03:29:25'),
(40, '2', '2', 12, 'Chicken Chat (S)', 'Pieces of chicken breast cooked with cucumber, fresh tomatoes and tangy chat masala sauce. A popular Indian street food.', NULL, '3.75', 0, 0, 0, 0, '2020-07-06 01:59:07', '2020-07-08 03:29:25'),
(41, '2', '2', 13, 'Aloo Chat (S)', '(V). Potatoes cooked with cucumber, fresh tomatoes and a tangy masala sauce', NULL, '3.10', 0, 0, 0, 0, '2020-07-06 01:59:29', '2020-07-08 03:29:25'),
(42, '2', '2', 14, 'Prawn Puree (S)', 'Juicy freshwater prawns tossed in a goan style medium spiced sauce with onions and tomatoes. Served on a light, flaky fried bread. Tantalisingly delicious and satisfying.', NULL, '3.95', 0, 0, 0, 0, '2020-07-06 01:59:50', '2020-07-08 03:29:25'),
(43, '2', '2', 15, 'King Prawn Puree (S)', 'Juicy jumbo king prawns tossed in a goan style sauce and served on a light, flaky fried bread.', NULL, '6.75', 0, 0, 0, 0, '2020-07-06 02:00:11', '2020-07-08 03:29:25'),
(44, '2', '2', 16, 'King Prawn Butterfly (S)', 'A whole freshwater king prawn expertly spiced, battered and coated in breadcrumbs and deep fried golden.', NULL, '4.75', 0, 0, 0, 0, '2020-07-06 02:00:39', '2020-07-08 03:29:25'),
(45, '2', '2', 17, 'Reshmi Kebab', 'Minced lamb blended with spices and onions made into pieces dipped in egg to give it a crisp texture leaving the mince soft inside', NULL, '4.95', 0, 0, 0, 0, '2020-07-06 02:00:55', '2020-07-08 03:29:25'),
(46, '2', '2', 18, 'Garlic Prawns', 'Garlic Prawns', NULL, '4.95', 0, 0, 0, 0, '2020-07-06 02:01:12', '2020-07-08 03:29:25'),
(47, '2', '2', 19, 'Stuffed Chilli', 'Stuffed Chillies Fresh chillies stuffed with cheese, covered in breadcrumbs, deep fried and served with aromatic dip', NULL, '4.95', 0, 0, 0, 0, '2020-07-06 02:01:29', '2020-07-08 03:29:25'),
(48, '2', '3', 1, 'Half Tandoori Chicken', 'Half Tandoori Chicken', NULL, '5.95', 0, 0, 0, 0, '2020-07-06 02:11:21', '2020-07-08 03:29:25'),
(49, '2', '3', 2, 'Full Tandoori Chicken', 'Full Tandoori Chicken', NULL, '9.95', 0, 0, 0, 0, '2020-07-06 02:11:34', '2020-07-08 03:29:25'),
(50, '2', '3', 3, 'Chicken Tikka Main', 'Chicken Tikka Main', NULL, '6.85', 0, 0, 0, 0, '2020-07-06 02:11:51', '2020-07-08 03:29:25'),
(51, '2', '3', 4, 'Lamb Tikka Main', 'Lamb Tikka Main', NULL, '6.85', 0, 0, 0, 0, '2020-07-06 02:12:12', '2020-07-08 03:29:25'),
(52, '2', '3', 5, 'Chicken Shashlik Main', 'Tender pieces of chicken marinated in tikka spices and barbecued with chunky pieces of onions, tomatoes and peppers. Grilled vegetables add a bold, rustic and fragrant touch.', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:12:30', '2020-07-08 03:29:25'),
(53, '2', '3', 6, 'Lamb Shashlik Main', 'Tender pieces of lamb marinated in tikka spices and barbecued with chunky pieces of onions, tomatoes and peppers. Grilled vegetables add a bold, rustic and fragrant touch.', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:12:51', '2020-07-08 03:29:25'),
(54, '2', '3', 7, 'King Prawn Shashlik Main', 'Jumbo king prawns marinated in mild tikka spices and yoghurt, then barbecues with wedges of onions, tomatoes and peppers.', NULL, '10.55', 0, 0, 0, 0, '2020-07-06 02:13:06', '2020-07-08 03:29:25'),
(55, '2', '3', 8, 'Tandoori King Prawn Main', 'Freshwater king prawns marinated in classic fragrant tandoori spices and yoghurt, barbecued over charcoal.', NULL, '9.55', 0, 0, 0, 0, '2020-07-06 02:13:24', '2020-07-08 03:29:25'),
(56, '2', '3', 9, 'Tandoori Mix Grill Main', 'A line up of Masala Boyz tandoori hall of fame. Featuring tandoori chicken, chicken and lamb tikka, sheek kebab. Supported by a plain nan, salad and mint sauce. Total caveman food and a real Bollywood blockbuster', NULL, '9.55', 0, 0, 0, 0, '2020-07-06 02:13:41', '2020-07-08 03:29:25'),
(57, '2', '4', 1, 'Tandoori Murgh Masala', 'Tandoori chicken cooked with minced meat and egg', NULL, '7.95', 0, 0, 0, 0, '2020-07-06 02:14:12', '2020-07-08 03:29:25'),
(58, '2', '4', 2, 'Tandoori Chicken Masala', 'Tandoori chicken off the bone cooked in our owen masala souve', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:14:31', '2020-07-08 03:29:25'),
(59, '2', '4', 3, 'Lamb Tikka Bahar', 'Succulent pieces of grilled chicken or lamb cooked in Masala Boyz own special Bahar sauce containing Bangladeshi citrus fruit, wedges of onion, tomatoes and green pepper. A highly fragrant dish, another Bangladeshi favourite.', NULL, '8.95', 0, 0, 0, 0, '2020-07-06 02:14:48', '2020-07-08 03:29:25'),
(60, '2', '4', 4, 'Tandoori King Prawn Masala', 'Barbecued jumbo king prawns cooked in Masala Boyz own masala sauce.', NULL, '9.95', 0, 0, 0, 0, '2020-07-06 02:15:04', '2020-07-08 03:29:25'),
(61, '2', '4', 5, 'Korai', 'Hot and spicy dish of chicken tikka or lamb tikka cooked with fresh garlic, wedges of onions, tomatoes and peppers to Masala Boyz special korai recipe.', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:15:36', '2020-07-08 03:29:25'),
(62, '2', '4', 6, 'Achrai', '(Slightly Hot) A rich, hot and spicy dish of chicken tikka or lamb tikka cooked with lime pickle and other secret ingredients. This is a sharp, tangy mouth watering dish which will wreak havoc on your taste buds', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:15:52', '2020-07-08 03:29:25'),
(63, '2', '4', 7, 'King Prawn Jalfrezi', '(Hot) Succulent king prawns cooked in the Jalfrezi style.', NULL, '9.95', 0, 0, 0, 0, '2020-07-06 02:16:18', '2020-07-08 03:29:25'),
(64, '2', '4', 8, 'Mango King Prawn', 'Creamy dish with ground almond, coconut with sliced mango\'s.', NULL, '9.95', 0, 0, 0, 0, '2020-07-06 02:16:56', '2020-07-08 03:29:25'),
(65, '2', '4', 9, 'Masala Boyz Special Bhuna', '(Combo) Lamb Tikka, Chicken and King prawn cooked in Masala Boyz special sauce medium spice new', NULL, '12.95', 0, 0, 0, 0, '2020-07-06 02:17:15', '2020-07-08 03:29:25'),
(66, '2', '4', 10, 'King Prawn Lava', '(Very Hot)', NULL, '13.95', 0, 0, 0, 0, '2020-07-06 02:17:39', '2020-07-08 03:29:25'),
(67, '2', '4', 11, 'King Prawn Kashmerie', 'King Prawn Kashmerie', NULL, '10.95', 0, 0, 0, 0, '2020-07-06 02:17:53', '2020-07-08 03:29:25'),
(68, '2', '4', 12, 'Jalfrezi', '(Hot) A spicy, fairly hot dish cooked with onions, green chillies, fresh tomatoes and fresh coriander. A classic favourite', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:18:11', '2020-07-08 03:29:25'),
(69, '2', '4', 13, 'Pasanda', 'Mild, creamy and nutty dish of tender pieces of grilled chicken tikka or lamb cooked with coconut, almond, pistachio, cashew nuts and cream with a hint of masala sauce. Seriously rich and scrumptious', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:18:24', '2020-07-08 03:29:25'),
(70, '2', '4', 14, 'PALOK', 'Masala Boyz famous tikka masala cooked with finely sliced green spinach, this adds great taste and colour to the iconic tikka masala, making this not just a great tasting dish but a feast for the eyes', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:18:40', '2020-07-08 03:29:25'),
(71, '2', '4', 15, 'Begooni', 'Delicious pieces of tender chicken or lamb cooked with wedges of aubergine and in a medium spiced onion and tomato based gravy, garnished with fresh coriander. Summer on a plate', NULL, '7.55', 0, 0, 0, 0, '2020-07-06 02:19:05', '2020-07-08 03:29:25'),
(72, '2', '4', 16, 'Bindi', 'Succulent pieces of chicken or lamb cooked with Okra in medium spices. The Okra provides fantastic flavour and an unusual texture', NULL, '7.55', 0, 0, 0, 0, '2020-07-06 02:19:20', '2020-07-08 03:29:25'),
(73, '2', '4', 17, 'Lava', '(Very Hot) Probably the hottest curry in the world', NULL, '10.95', 0, 0, 0, 0, '2020-07-06 02:19:37', '2020-07-08 03:29:25'),
(74, '2', '4', 18, 'Kashmerie', 'Mild creamy dish with dry fruits.', NULL, '9.95', 0, 0, 0, 0, '2020-07-06 02:20:00', '2020-07-08 03:29:25'),
(75, '2', '4', 19, 'Paneer', 'NEW. Chicken or lamb cooked tikka with Cheese.', NULL, '9.95', 0, 0, 0, 0, '2020-07-06 02:20:22', '2020-07-08 03:29:25'),
(76, '2', '4', 20, 'Garlic Tikka', 'Love garlic, you’ll love this, chicken or lamb tikka cooked with chunky onions, tomatoes and peppers in a rich, spicy sauce crammed with fresh garlic. Tip: have a pack of mints to hand, otherwise could seriously affect your pulling power', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:20:36', '2020-07-08 03:29:25'),
(77, '2', '4', 21, 'Butter Chicken', 'Seriously rich and scrumptious dish of tender pieces of grilled chicken cooked in a thick, creamy and buttery sauce', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:20:52', '2020-07-08 03:29:25'),
(78, '2', '4', 22, 'Tikka Chilli Masala (hot)', 'Hot, fiery, spicy dish of succulent chicken tikka or lamb tikka cooked with, green chillies, wedges of onions, tomatoes, peppers and Masala Boyz special masala sauce. Looks fantastic, tastes even better', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:21:09', '2020-07-08 03:29:25'),
(79, '2', '4', 23, 'Tikka Masala', 'The dish that launched a thousand restaurants. A classic favourite made even better with chef’s special masala sauce.', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:21:22', '2020-07-08 03:29:25'),
(80, '2', '4', 24, 'Peri Peri Tikka', '(Hot) A Masala Boyz creation, tender pieces of grilled chicken tikka, lamb tikka, prawn or king prawn in a wonderfully flavor some hot, sweet and sour sauce containing tamarind, coconut and peri peri chillies.', NULL, '8.95', 0, 0, 0, 0, '2020-07-06 02:23:33', '2020-07-08 03:29:25'),
(81, '2', '4', 25, 'Paneer Tikka Masala', 'NEW. Paneer tikka masala is an Indian dish of marinated paneer cheese served in a spiced gravy. It is a vegetarian alternative to chicken tikka masala.', NULL, '7.95', 0, 0, 0, 0, '2020-07-06 02:24:09', '2020-07-08 03:29:25'),
(82, '2', '4', 26, 'Chicken Mahknee', 'North west frontier strips of tender char grilled chicken cooked with fresh tomatoes, honey and creamy butter sauce.', NULL, '7.25', 0, 0, 0, 0, '2020-07-06 02:24:28', '2020-07-08 03:29:25'),
(83, '2', '4', 27, 'Ocean Catch', 'Primed fish fillet pieces spiced and pan fried, then cooked with prawns in a medium spiced rich sauce of onions and tomatoes', NULL, '9.75', 0, 0, 0, 0, '2020-07-06 02:24:48', '2020-07-08 03:29:25'),
(84, '2', '4', 28, 'Bombay Sweet Chilli', 'Sliced chicken tikka from the tandoor is prepared with fresh garlic and chopped onions with our own special sweet chilli sauce on this medium dish', NULL, '8.95', 0, 0, 0, 0, '2020-07-06 02:25:20', '2020-07-08 03:29:25'),
(85, '2', '4', 29, 'Tiger Special', 'This non creamy mild and exotic dish comes highly recommended to you. It is cooked with Masala Boyz very own tiger chutney and gharam masala. Once tasted never forgetten.', NULL, '8.95', 0, 0, 0, 0, '2020-07-06 02:25:39', '2020-07-08 03:29:25'),
(86, '2', '4', 30, 'Bombay Sweet Chilli', 'New Chefs special spice', NULL, '8.95', 0, 0, 0, 0, '2020-07-06 02:25:54', '2020-07-08 03:29:25'),
(87, '2', '4', 31, 'Hari Mirchi', 'Hot, sweet and sour with tamarind sauce', NULL, '7.95', 0, 0, 0, 0, '2020-07-06 02:26:10', '2020-07-08 03:29:25'),
