(1, '2', 'about', 'Anout Us', '<p><span style=\"font-size: 32px;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: 32px;\">Order food Via our apps in Tamworth! It\'s so easy to use, fast and convenient. Try our new, online website which contains our entire takeaway menu. The Masala Boyz is located opposite Tamworth Train Station. You can now order online, all your favorite dishes and many more delicious options available. We are fully licensed and an air-conditioned restaurant.</span></p>\r\n<p><span style=\"font-size: 32px;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: 32px;\">Here at Masala Boyz we are constantly striving to improve our service and quality in order to give our customers the very best experience. As a result, we are finally proud to unveil and introduce our latest improvement, our new Android and IOS Mobile Application You can now relax at home and order your favourite, freshly prepared meals from Masala Boyz and have it delivered to your home free of charge within 2 miles of Radius. You can even pay via the app!</span></p>\r\n<p><span style=\"font-size: 32px;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: 32px;\">Thank you for visiting Masala Boyz in Tamworth. We hope you enjoy our online ordering website and your food.</span>&nbsp;</p>\r\n<p><span style=\"font-size: 24pt;\">compelling content. Building a website is, in many ways, an exercise of willpower. It&rsquo;s tempting to get distracted by the bells and whistles of the design process, and forget all about creating compelling content. Building a website is, in many ways, an exercise of willpower. It&rsquo;s tempting to get distracted by the bells and whistles of the design process, and forget all about creating compelling content. Building a website is, in many ways, an exercise of willpower. It&rsquo;s tempting to get distracted by the bells and whistles of the design process,</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 24pt;\"> and forget all about creating compelling content. Building a website is, in many ways, an exercise of willpower. It&rsquo;s tempting to get distracted by the bells and whistles of the design process, and forget all about creating </span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 24pt;\">compelling content. Building a website is, in many ways, an exercise of willpower. It&rsquo;s tempting to get distracted by the bells and whistles of the design process, and forget all about creating compelling content.</span></p>', '2020-03-20 00:00:00', '2020-07-06 17:39:24'),
