t listed on any U.S. Government list of prohibited or restricted parties.</p>\r\n<h3>10. CONTACT INFORMATION</h3>\r\n<p>For general inquiries, complaints, questions or claims concerning the licensed Application, please contact:</p>\r\n<p>Shaker Hussain<br /> Hindlow Close<br /> Birmingham, west midlands b7 4lj<br /> United Kingdom<br /> Sales@superappsolutions.com</p>\r\n<h3>11. TERMINATION</h3>\r\n<p>The license is valid until terminated by Super App Solutions or by You. Your rights under this license will terminate automatically and without notice from Super App Solutions if You fail to adhere to any term(s) of this license. Upon License termination, You shall stop all use of the Application, and destroy all copies, full or partial, of the Application.</p>\r\n<h3>12. THIRD-PARTY TERMS OF AGREEMENTS AND BENEFICIARY</h3>\r\n<p>Super App Solutions represents and warrants that Super App Solutions will comply with applicable third-party terms of agreement when using licensed Application.</p>\r\n<p>In Accordance with Section 9 of the \"Instructions for Minimum Terms of Developer\'s End-User License Agreement,\" Apple and Apple\'s subsidiaries shall be third-party beneficiaries of this End User License Agreement and - upon Your acceptance of the terms and conditions of this license agreement, Apple will have the right (and will be deemed to have accepted the right) to enforce this End User License Agreement against You as a third-party beneficiary thereof.</p>\r\n<h3>13. INTELLECTUAL PROPERTY RIGHTS</h3>\r\n<p>Super App Solutions and the End-User acknowledge that, in the event of any third-party claim that the licensed Application or the End-User\'s possession and use of that licensed Application infringes on the third party\'s intellectual property rights, Super App Solutions, and not Apple, will be solely responsible for the investigation, defence, settlement and discharge or any such intellectual property infringement claims.</p>\r\n<h3>14. APPLICABLE LAW</h3>\r\n<p>This license agreement is governed by the laws of the United Kingdom excluding its conflicts of law rules.</p>\r\n<h3>15. MISCELLANEOUS</h3>\r\n<p>15.1 If any of the terms of this agreement should be or become invalid, the validity of the remaining provisions shall not be affected. Invalid terms will be replaced by valid ones formulated in a way that will achieve the primary purpose.</p>\r\n<p>15.2 Collateral agreements, changes and amendments are only valid if laid down in writing. The preceding clause can only be waived in writing.</p>\r\n<p>15.3 On installing the application you will receive 1000 credits to use to chat to other users from different locations who speak a different language. There will be multiple packages available for users to purchase more credits using the in app purchases available in accordance to apple.</p>', '2020-03-20 00:00:00', '2020-07-06 17:47:50'),
(3, '2', 'privacy', 'Privacy Policy', '<p>Privacy Policy</p>\r\n<p>Thank you for choosing to be part of our community at Super App Solutions (\"Company\", \"we\", \"us\", or \"our\"). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about our notice, or our practices with regards to your personal information, please contact us at sales@superappsolutions.com.</p>\r\n<p>When you visit our mobile application, and use our services, you trust us with your personal information. We take your privacy very seriously. In this privacy notice, we seek to explain to you in the clearest way possible what information we collect, how we use it and what rights you have in relation to it. We hope you take some time to read through it carefully, as it is important. If there are any terms in this privacy notice that you do not agree with, please discontinue use of our Apps and our services.</p>\r\n<p>This privacy notice applies to all information collected through our mobile application, (\"Apps\"), and/or any related services, sales, marketing or events (we refer to them collectively in this privacy notice as the \"Services\").</p>\r\n<p>Please read this privacy notice carefully as it will help you make informed decisions about sharing your personal information with us.</p>\r\n<h3>TABLE OF CONTENTS</h3>\r\n<p>1. WHAT INFORMATION DO WE COLLECT?</p>\r\n<p>2. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</p>\r\n<p>3. HOW LONG DO WE KEEP YOUR INFORMATION?</p>\r\n<p>4. HOW DO WE KEEP YOUR INFORMATION SAFE?</p>\r\n<p>5. DO WE COLLECT INFORMATION FROM MINORS?</p>\r\n<p>6. WHAT ARE YOUR PRIVACY RIGHTS?</p>\r\n<p>7. CONTROLS FOR DO-NOT-TRACK FEATURES</p>\r\n<p>8. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</p>\r\n<p>9. DO WE MAKE UPDATES TO THIS POLICY?</p>\r\n<p>10. HOW CAN YOU CONTACT US ABOUT THIS POLICY?</p>\r\n<h3>1. WHAT INFORMATION DO WE COLLECT?</h3>\r\n<p>Information automatically collected</p>\r\n<p>In Short: Some information - such as IP address and/or browser and device characteristics - is collected automatically when you visit our Apps.</p>\r\n<p>We automatically collect certain information when you visit, use or navigate the Apps. This information does not reveal your specific identity (like your name or contact information) but may include device and usage information, such as your IP address, browser and device characteristics, operating system, language preferences, referring URLs, device name, country, location, information about how and when you use our Apps and other technical information. This information is primarily needed to maintain the security and operation of our Apps, and for our internal analytics and reporting purposes.</p>\r\n<p>Information collected through our Apps</p>\r\n<p>In Short: We may collect information regarding your push notifications, when you use our apps.</p>\r\n<p>If you use our Apps, we may also collect the following information:</p>\r\n<p>Push Notifications. We may request to send you push notifications regarding your account or the mobile application. If you wish to opt-out from receiving these types of communications, you may turn them off in your devices settings.</p>\r\n<h3>2. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</h3>\r\n<p>In Short: We only share information with your consent, to comply with laws, to provide you with services, to protect your rights, or to fulfill business obligations.</p>\r\n<p>We may process or share data based on the following legal basis:</p>\r\n<p>Consent: We may process your data if you have given us specific consent to use your personal information in a specific purpose.</p>\r\n<p>Legitimate Interests: We may process your data when it is reasonably necessary to achieve our legitimate business interests.</p>\r\n<p>Performance of a Contract: Where we have entered into a contract with you, we may process your personal information to fulfill the terms of our contract.</p>\r\n<p>Legal Obligations: We may disclose your information where we are legally required to do so in order to comply with applicable law, governmental requests, a judicial proceeding, court order, or legal process, such as in response to a court order or a subpoena (including in response to public authorities to meet national security or law enforcement requirements).</p>\r\n<p>Vital Interests: We may disclose your information where we believe it is necessary to investigate, prevent, or take action regarding potential violations of our policies, suspected fraud, situations involving potential threats to the safety of any person and illegal activities, or as evidence in litigation in which we are involved.</p>\r\n<p>More specifically, we may need to process your data or share your personal information in the following situations:</p>\r\n<p>Vendors, Consultants and Other Third-Party Service Providers. We may share your data with third party vendors, service providers, contractors or agents who perform services for us or on our behalf and require access to such information to do that work. Examples include: payment processing, data analysis, email delivery, hosting services, customer service and marketing efforts. We may allow selected third parties to use tracking technology on the Apps, which will enable them to collect data about how you interact with the Apps over time. This information may be used to, among other things, analyze and track data, determine the popularity of certain content and better understand online activity. Unless described in this Policy, we do not share, sell, rent or trade any of your information with third parties for their promotional purposes.</p>\r\n<p>Business Transfers. We may share or transfer your information in connection with, or during negotiations of, any merger, sale of company assets, financing, or acquisition of all or a portion of our business to another company.</p>\r\n<p>Third-Party Advertisers. We may use third-party advertising companies to serve ads when you visit the Apps. These companies may use information about your visits to our Website(s) and other websites that are contained in web cookies and other tracking technologies in order to provide advertisements about goods and services of interest to you.</p>\r\n<h3>3. HOW LONG DO WE KEEP YOUR INFORMATION?</h3>\r\n<p>In Short: We keep your information for as long as necessary to fulfill the purposes outlined in this privacy notice unless otherwise required by law.</p>\r\n<p>We will only keep your personal information for as long as it is necessary for the purposes set out in this privacy notice, unless a longer retention period is required or permitted by law (such as tax, accounting or other legal requirements). No purpose in this policy will require us keeping your personal information for longer than 1 year.</p>\r\n<p>When we have no ongoing legitimate business need to process your personal information, we will either delete or anonymize it, or, if this is not possible (for example, because your personal information has been stored in backup archives), then we will securely store your personal information and isolate it from any further processing until deletion is possible.</p>\r\n<h3>4. HOW DO WE KEEP YOUR INFORMATION SAFE?</h3>\r\n<p>In Short: We aim to protect your personal information through a system of organizational and technical security measures.</p>\r\n<p>We have implemented appropriate technical and organizational security measures designed to protect the security of any personal information we process. However, please also remember that we cannot guarantee that the internet itself is 100% secure. Although we will do our best to protect your personal information, transmission of personal information to and from our Apps is at your own risk. You should only access the services within a secure environment.</p>\r\n<h3>5. DO WE COLLECT INFORMATION FROM MINORS?</h3>\r\n<p>In Short: We do not knowingly collect data from or market to children under 18 years of age.</p>\r\n<p>We do not knowingly solicit data from or market to children under 18 years of age. By using the Apps, you represent that you are at least 18 or that you are the parent or guardian of such a minor and consent to such minor dependent&acirc;&euro;&trade;s use of the Apps. If we learn that personal information from users less than 18 years of age has been collected, we will deactivate the account and take reasonable measures to promptly delete such data from our records. If you become aware of any data we have collected from children under age 18, please contact us at sales@superappsolutions.com.</p>\r\n<h3>6. WHAT ARE YOUR PRIVACY RIGHTS?</h3>\r\n<p>In Short: In some regions, such as the European Economic Area, you have rights that allow you greater access to and control over your personal information. You may review, change, or terminate your account at any time.</p>\r\n<p>In some regions (like the European Economic Area), you have certain rights under applicable data protection laws. These may include the right (i) to request access and obtain a copy of your personal information, (ii) to request rectification or erasure; (iii) to restrict the processing of your personal information; and (iv) if applicable, to data portability. In certain circumstances, you may also have the right to object to the processing of your personal information. To make such a request, please use the contact details provided below. We will consider and act upon any request in accordance with applicable data protection laws.</p>\r\n<p>If we are relying on your consent to process your personal information, you have the right to withdraw your consent at any time. Please note however that this will not affect the lawfulness of the processing before its withdrawal.</p>\r\n<p>If you are resident in the European Economic Area and you believe we are unlawfully processing your personal information, you also have the right to complain to your local data protection supervisory authority. You can find their contact details here: click here</p>\r\n<h3>7. CONTROLS FOR DO-NOT-TRACK FEATURES</h3>\r\n<p>Most web browsers and some mobile operating systems and mobile applications include a Do-Not-Track (\"DNT\") feature or setting you can activate to signal your privacy preference not to have data about your online browsing activities monitored and collected. No uniform technology standard for recognizing and implementing DNT signals has been finalized. As such, we do not currently respond to DNT browser signals or any other mechanism that automatically communicates your choice not to be tracked online. If a standard for online tracking is adopted that we must follow in the future, we will inform you about that practice in a revised version of this privacy notice.</p>\r\n<h3>8. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</h3>\r\n<p>In Short: Yes, if you are a resident of California, you are granted specific rights regarding access to your personal information.</p>\r\n<p>California Civil Code Section 1798.83, also known as the \"Shine The Light\" law, permits our users who are California residents to request and obtain from us, once a year and free of charge, information about categories of personal information (if any) we disclosed to third parties for direct marketing purposes and the names and addresses of all third parties with which we shared personal information in the immediately preceding calendar year. If you are a California resident and would like to make such a request, please submit your request in writing to us using the contact information provided below.</p>\r\n<p>If you are under 18 years of age, reside in California, and have a registered account with the Apps, you have the right to request removal of unwanted data that you publicly post on the Apps. To request removal of such data, please contact us using the contact information provided below, and include the email address associated with your account and a statement that you reside in California. We will make sure the data is not publicly displayed on the Apps, but please be aware that the data may not be completely or comprehensively removed from our systems.</p>\r\n<h3>9. DO WE MAKE UPDATES TO THIS POLICY?</h3>\r\n<p>In Short: Yes, we will update this policy as necessary to stay compliant with relevant laws.</p>\r\n<p>We may update this privacy notice from time to time. The updated version will be indicated by an updated \"Revised\" date and the updated version will be effective as soon as it is accessible. If we make material changes to this privacy notice, we may notify you either by prominently posting a notice of such changes or by directly sending you a notification. We encourage you to review this privacy notice frequently to be informed of how we are protecting your information.</p>\r\n<h4>HOW CAN YOU REVIEW, UPDATE, OR DELETE THE DATA WE COLLECT FROM YOU?</h4>\r\n<p>Based on the laws of some countries, you may have the right to request access to the personal information we collect from you, change that information, or delete it in some circumstances. To request to review, update, or delete your personal information, please submit a request form by clicking here. We will respond to your request within 30 days.</p>', '2020-03-20 00:00:00', '2020-07-06 17:47:31');
